import base64

def base64_to_docx(base64_string, output_file_path):
    try: 
        # Step 3: Decode the Base64 string to binary data
        binary_data = base64.b64decode(base64_string)
        # Step 4: Write the binary data to a .docx file
        with open(output_file_path, 'wb') as file:
            file.write(binary_data)
        print(f"File saved successfully to {output_file_path}")
    except Exception as e:
        print(f"An error occurred: {e}")

# Example usage
if __name__ == "__main__":
    base64_string = ""
    output_file_path = "output.docx"
    base64_to_docx(base64_string, output_file_path)